    radios: [
      {id: 1, value: 'javascript'},
      {id: 1, value: 'javascript'},
      {id: 1, value: 'javascript'},
      {id: 1, value: 'javascript'}
    ]
  };




  render() {

    let {projects} = this.state;

    return (
      <div className='portfolioContent'>
        <ul className='radioDisplay'>

        </ul>
        <div className='projects'>
          {
             projects.map(item =>{
               return(
                 <Project
                  key={item.id}
                  item={item}
                 />
               )
             })
          }
        </div>

      </div>
    )
  }
}
